/**
 * swap key to value and swap value to key
 * does not mutate object
 * return new object
 * @param {{ [prop: string]: string }} - object that you want to swap
 * @return {[prop:string]: string}
 */
export declare const swapKeyAndValue: (obj: {
    [prop: string]: string;
}) => {
    [prop: string]: string;
};
